import React, { useEffect } from 'react';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';

function MapComponent() {
  useEffect(() => {
    // Khởi tạo bản đồ
    const map = L.map('map').setView([21.028511, 105.804817], 13); // Hà Nội

    // Thêm tile layer từ OpenStreetMap
    L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
      attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
    }).addTo(map);

    // Thêm marker tại vị trí bất kỳ trong Hà Nội
    L.marker([21.028511, 105.804817]).addTo(map)
      .bindPopup('Vị trí bất kỳ tại Hà Nội.')
      .openPopup();

    // Cleanup function khi component bị unmount
    return () => {
      map.remove();
    };
  }, []);

  return (
    <div id="map" style={{ height: '100%', width: '100%' }}></div>
  );
}

export default MapComponent;
